me": "subTitle", "value": "Nordisk mobilitet i tiden efter covid-19"}], "repeatId": "18", "attributes": {"lang": "swe", "type": "alternative"}}, {"name": "name", "children": [{"name": "person", "children": [{"name": "linkedRecordType", "value": "diva-person"}, {"name": "linkedRecordId", "value": "diva-person:8528307257674963"}]}, {"name": "role", "children": [{"name": "roleTerm", "value": "aut", "repeatId": "0"}]}], "repeatId": "2", "attributes": {"type": "personal"}}, {"name": "name", "children": [{"name": "namePart", "value": "Doe", "attributes": {"type": "family"}}, {"name": "namePart", "value": "John", "attributes": {"type": "given"}}, {"name": "role", "children": [{"name": "roleTerm", "value": "trl", "repeatId": "0"}]}], "repeatId": "9", "attributes": {"type": "personal"}}, {"name": "note", "value": "12", "attributes": {"type": "creatorCount"}}, {"name": "abstract", "value": "What happens to Nordic mobility in a world of pandemic, lockdown, isolation, home offices and social distancing? Has the pandemic led us closer to a greener future, seeing that behavioural patterns may change almost overnight and automatically reducing our carbon footprints? Do Nordic businesses see new opportunities on the post-pandemic horizon, and what can be said about the role of Nordic cooperation in times of recovery and change?\\n\\nChanging frameworks such as the current pandemic, but also the climate crisis and technological advancements are creating both a great need and new possibilities for innovation. For these reasons, Nordic Innovation developed the Nordic Smart Mobility and Connectivity program that aims to help develop a more sustainable, integrated and connected transport system Nordic region while generating opportunities for Nordic businesses.\\n\\nWe can now see that despite the sudden lockdowns, goods are still being transported across the globe and even the odd traveller, the infrastructure, is still in place and operating. The current pandemic has made us realize that without our mobility systems we would be much worse off. We also know that the pandemic is not here to stay, and that there are huge efforts being made across the Nordic countries to make something good and positive come out of the crisis.\\n\\nTo showcase these efforts and to highlight the possibilities that collaboration across Nordic countries can bring, nine Nordic mobility projects co-financed by Nordic Innovation share their thoughts on the near future and their relevance in the post-pandemic era.", "repeatId": "3", "attributes": {"lang": "eng"}}, {"name": "subject", "children": [{"name": "topic", "value": "Yrkeskunnande, Yrkeslärare, Yrkesutbildning"}], "repeatId": "4", "attributes": {"lang": "swe"}}, {"name": "originInfo", "children": [{"name": "dateIssued", "children": [{"name": "year", "value": "2012"}, {"name": "month", "value": "01"}, {"name": "day", "value": "23"}]}, {"name": "copyrightDate", "children": [{"name": "year", "value": "2012"}, {"name": "month", "value": "03"}, {"name": "day", "value": "03"}]}, {"name": "dateOther", "children": [{"name": "year", "value": "2012"}, {"name": "month", "value": "02"}, {"name": "day", "value": "01"}], "attributes": {"type": "online"}}, {"name": "agent", "children": [{"name": "namePart", "value": "Mitt fina förlag", "repeatId": "1"}, {"name": "role", "children": [{"name": "roleTerm", "value": "pbl"}]}]}, {"name": "place", "children": [{"name": "placeTerm", "value": "Uppsala"}], "repeatId": "0"}, {"name": "edition", "value": "200"}]}, {"name": "extent", "value": "32s"}, {"name": "classification", "value": "1", "repeatId": "5", "attributes": {"authority": "ssif"}}, {"name": "subject", "children": [{"name": "topic", "children": [{"name": "linkedRecordType", "value": "diva-subject"}, {"name": "linkedRecordId", "value": "diva-subject:8528498633661315"}], "repeatId": "0"}], "attributes": {"authority": "diva"}}, {"name": "identifier", "value": "978-92-893-8293-9", "repeatId": "6", "attributes": {"type": "isbn", "displ